import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import Particle from "../Particle";
import "../../style.css";
import "bootstrap/dist/css/bootstrap.min.css";
import myImg from "../../Assets/figure.png";
import "../../style.css";
import Tilt from "react-parallax-tilt";
import Techstack from "./Techstack";
import IMG_1 from "../../Assets/9.svg";
import IMG_2 from "../../Assets/3.svg";
import Aboutcard from "./AboutCard";
// import Home2 from "./Home2";

function About() {
  return (
    <Container fluid className="about-section" >

      <Container>
        <Row style={{ justifyContent: "center", padding: "10px",paddingTop: "180px", paddingBottom: "150px" }}>
          <Col
            md={7}
            style={{
              justifyContent: "center",
              paddingTop: "30px",
              paddingBottom: "50px",
            }}
          >
            <h1 style={{ fontSize: "2.1em", paddingBottom: "20px" }}>
              Know Who <strong className="purple">I'M</strong>

            </h1>
            <Aboutcard />
          </Col>
          {/* <Col
            md={5}
            style={{ paddingTop: "120px", paddingBottom: "50px" }}
            className="about-img"
          >
            <img src={laptopImg} alt="about" className="img-fluid" />
          </Col> */}
          <Col md={5} className="myAvtar"   >
            <Tilt>
              <img src={myImg} className="img-fluid" alt="avatar" />
            </Tilt>
          </Col>
        </Row>

        <h1 className="project-heading">
          Professional <strong className="purple">Skillset </strong>
        </h1>
        <Row style={{ justifyContent: "center", paddingBottom: "50px" }}>
        <Col xs={4} md={2} >
        <div class="wrapper1">
          <div class="container1" id="c01">
          <img src={IMG_1} className="img-fluid" alt="avatar" />
          {/* <i className={`${prop.iconName} tech-icon-images`}></i> */}
          </div>
          </div>
      </Col>
      <Col xs={4} md={2} >
        <div class="wrapper1">
          <div class="container1" id="c01">
          <img src={3} className="img-fluid" alt="avatar" />
          {/* <i className={`${prop.iconName} tech-icon-images`}></i> */}
          </div>
          </div>
      </Col>


          <Techstack iconName="devicon-python-plain-wordmark " />
          <Techstack iconName="cib-pytorch" />
          <Techstack iconName="cib-tensorflow" />
          <Techstack iconName="devicon-javascript-plain " />
          <Techstack iconName="devicon-nodejs-plain-wordmark " />
          <Techstack iconName="devicon-express-original-wordmark" />
          <Techstack iconName="devicon-react-original-wordmark" />
          <Techstack iconName="devicon-mongodb-plain-wordmark" />
          <Techstack iconName="devicon-git-plain-wordmark" />
          <Techstack iconName="devicon-bootstrap-plain-wordmark" />
        </Row>
        <h1 className="project-heading">
          <strong className="purple">Tools</strong> I use
        </h1>
        <Row style={{ justifyContent: "center", paddingBottom: "50px" }}>
          <Techstack iconName="devicon-linux-plain" />
          <Techstack iconName="cib-visual-studio-code" />
          <Techstack iconName="cib-anaconda" />
          <Techstack iconName="cib-postman" />
          <Techstack iconName="cib-zeit" />
          <Techstack iconName="cib-heroku" />
        </Row>
        {/* <Home2/> */}
      </Container>
    </Container>
  );
}

export default About;
